import React, { Component } from 'react'
import { getUsers } from '../api/apiCalls'

export default class UserList extends Component {

    state = {
        users: []
    }

    componentDidMount() {
        getUsers().then( (response) => {
            this.setState({
                users: response.data
            })
        })
    }

    render() {
        return (
        <div>UserList</div>
        )
    }
}
